import React from "react";
import Card from "./Card";
import haitamImg from "../images/haitam.jpg";
import salouaImg from "../images/saloua.jpeg";
import yassinImg from "../images/yassin.jpg";
import zaydImg from "../images/zayd.jpg";

function Team() {
  return (
    <div className="row">
      <div className="col-sm-6 col-md-4 col-lg-3">
        <Card image={haitamImg} />
      </div>
      <div className="col-sm-6 col-md-4 col-lg-3">
        <Card image={haitamImg} />
      </div>
      <div className="col-sm-6 col-md-4 col-lg-3">
        <Card image={haitamImg} />
      </div>
      <div className="col-sm-6 col-md-4 col-lg-3">
        <Card image={haitamImg} />
      </div>
    </div>
  );
}

export default Team;
